            "scroll-feature.header": "... Und **Mehr**",
            "scroll-feature.modifiers.body": "Halte beim Scrollen eine Sondertaste auf deinem Keyboard gedr\u00fcckt, um **pr\u00e4zise zu scrollen**, **rein- oder rauszuzoomen** und mehr.",
            "scroll-feature.modifiers.title": "Sondertasten",
