            "scroll-smoothness.header": "W\u00e4hle eine **Scroll-Fl\u00fcssigkeit** ...",
            "scroll-smoothness.high.body": "Mit *Fl\u00fcssigkeit: Hoch*, f\u00fchlt sich das Scrollen **unglaublich fl\u00fcssig** an - **genau wie bei einem Trackpad**. Details wie der dezente R\u00fcckprall am Ende einer Seite sorgen f\u00fcr ein dynamisches und angenehmes Scroll-Gef\u00fchl. Trotzdem ist das Scrollen super reaktionsschnell und leicht zu steuern. Mit dieser Option kannst du auch sehr leicht weite Strecken scrollen.",
            "scroll-smoothness.high.title": "Fl\u00fcssigkeit: **Hoch**",
            "scroll-smoothness.off.body": "Mit *Fl\u00fcssigkeit: Aus* funktioniert das Scrollen wie gewohnt unter macOS - **ohne jede Animation** oder Gl\u00e4ttung. Aber mit einem entscheidenden Unterschied: **Eine Raste des Scrollrads** scrollt eine **festgelegte Anzahl von *Zeilen***, statt nur ein paar Pixel. Das macht die Navigation konsistenter und angenehmer.\n\nSo funktioniert das Scrollen auch in den meisten Apps auf Windows und Linux, sowie in \u00e4lteren macOS-Versionen.",
            "scroll-smoothness.off.title": "Fl\u00fcssigkeit: **Aus**",
            "scroll-smoothness.regular.body": "W\u00e4hle *Fl\u00fcssigkeit: Regul\u00e4r* f\u00fcr **reaktionsschnelles** Scrollen, das sich anf\u00fchlt, **als w\u00fcrdest du die Seite direkt mit dem Finger schieben**. Die kurzen, schwungbasierten Animationen bieten ein raffiniertes Scroll-Gef\u00fchl.\n\nDiese Option f\u00fchlt sich \u00e4hnlich an wie das Scrollen in Chrome oder modernen Windows-Apps.",
            "scroll-smoothness.regular.title": "Fl\u00fcssigkeit: **Regul\u00e4r**",
